import React, { useState } from 'react'
import {Form} from 'react-bootstrap'
const Search = () => {
  const [keywords, setKeywords] = useState("");
  return (
    <Form.Control 
      type="text"
      value={keywords}
      onChange={(e)=> setKeywords(e.target.value)}
    ></Form.Control>
  )
}

export default Search
